CREATE DEFINER=`root`@`localhost` PROCEDURE `bpjs` (IN `empcode` VARCHAR(50))  if (empcode <> "") then
				  Select a.EmployeeCode, a.FullName, SUM(a.BasicRate * b.IuranPensiun / 100 ) as BPJS from db_payrolldata a, db_setpayroll b where a.EmployeeCode = empcode;  
				  else
				  Select a.EmployeeCode, a.FullName, SUM(a.BasicRate * b.IuranPensiun / 100 ) as BPJS from db_payrolldata a, db_setpayroll b;  				  				   
end if$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `completedloan` (IN `empcode` INT)  BEGIN
delete from db_loan where Realisasi = curdate;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `deleteloan` (IN `empcode` VARCHAR(20))  BEGIN
Delete from db_loan
WHERE EmployeeCode = empcode;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `gross` (IN `empcode` VARCHAR(20))  Begin
     if (empcode <> "") then   
        SELECT EmployeeCode, FullName, SUM(BasicRate + Allowance + Incentives + MealRate + Transport) as gross from db_payrolldata where EmployeeCode = empcode;       
       else
        SELECT EmployeeCode, FullName, SUM(BasicRate + Allowance + Incentives + MealRate + Transport) as gross from db_payrolldata;		          
 end if; 
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `hitung_gaji` (IN `empcode` VARCHAR(50))  if (empcode<>"") then
select * from db_pegawai where EmployeeCode=empcode;
else 
select * from db_pegawai;
end if$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `loadreports` (IN `startdate` DATE, IN `UpTo` DATE)  BEGIN
select RecruitmentReport from reports where fltdate between startdate and UpTo;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `test` (IN `empcode` VARCHAR(50))  if (empcode <> "" ) then
select a.EmployeeCode, a.FullName,  a.BasicRate + a.Allowance + a.Incentives + a.MealRate + a.Transport as Grosses, a.BasicRate * b.Bpjs / 100 as HasilBpjs, a.BasicRate * b.IuranPensiun / 100 as IuranPensiun, a.BasicRate * b.JaminanKesehatan / 100 as JaminanKesehatan, a.BasicRate * b.JaminanHariTua / 100 as JaminanHariTua, a.BasicRate * b.BiayaJabatan / 100 as BiayaJabatan from db_payrolldata a, db_setpayroll b where EmployeeCode = empcode;
else
select a.EmployeeCode, a.FullName,  a.BasicRate + a.Allowance + a.Incentives + a.MealRate + a.Transport as Grosses, a.BasicRate * b.Bpjs / 100 as HasilBpjs, a.BasicRate * b.IuranPensiun / 100 as IuranPensiun, a.BasicRate * b.JaminanKesehatan / 100 as JaminanKesehatan, a.BasicRate * b.JaminanHariTua / 100 as JaminanHariTua, a.BasicRate * b.BiayaJabatan / 100 as BiayaJabatan from db_payrolldata a, db_setpayroll b;
end if$$

